import Header from "./components/Header/Header.js";
import Form from "./components/Form/Form.js";
import Table from "./components/Table/Table.js";

function App() {
  const Data = [
    {
      year: 2001,
      totalSaving: 1000,
      interest: 10,
      totalInterest: 10,
      investedCapital: 100,
    },
    {
      year: 2002,
      totalSaving: 2000,
      intersest: 20,
      totalInterest: 20,
      investedCapital: 200,
    },
    {
      year: 2003,
      totalSaving: 3000,
      intersest: 30,
      totalInterest: 30,
      investedCapital: 300,
    },
    {
      year: 2004,
      totalSaving: 4000,
      intersest: 40,
      totalInterest: 40,
      investedCapital: 400,
    },
  ];
  return (
    <div>
      <Header></Header>
      <Form></Form>
      {/* Todo: Show below table conditionally (only once result data is available) */}
      {/* Show fallback text if no data is available */}
      <Table Data={Data}></Table>
    </div>
  );
}

export default App;
